        <div style={{backgroundColor: '#001220'}} className="text-center">
        <div className="spacer layer3 d-grid justify-content-center align-items-center grid-wrap" style={{margintop: '3em'}}>
        <span className="sho rounded-pill" style={{width: '35vw',backgroundColor: "#001220",position: 'relative',
      right: '.8%',
      top: '-45.5%',}}><h1 style={styles.title}>FANIMISS</h1></span>


        </div>
        <div className="d-grid justify-content-center align-items-center grid-wrap" style={{position: 'relative', bottom: '0vh'}}>
            <div className="rounded-pill d-grid justify-content-center align-items-center grid-wrap" style={{width: '76vw', height: '13vh', backgroundColor: 'rgb(35 52 72)'}}><div className="sho rounded-pill" style={{position: 'relative',width: '74vw', backgroundColor: 'rgb(76 104 133)',height: '10vh', bottom: 3}}><input></input></div></div>
